import React from "react";
import { useState } from "react";

const Friday14july = () => {
  const [count, setCount] = useState(0);

  const add = () => {
    setCount(count + 1);
  };
  const minus = () => {
    setCount(count - 1);
  };
  return (
    <div>
      <button onClick={add} className="btn btn-primary">
        Add
      </button>
      <div>{count}</div>
      <button onClick={minus} className="btn btn-primary">
        Add
      </button>
    </div>
  );
};

export default Friday14july;
